import React,{Component} from 'react';
import ServiceCard from '../Components/ServiceCard';
import axios from 'axios';


class SearchScreen extends Component{
	state={
		'datas':[],
	}

	componentDidMount(){
		axios.post('http://127.0.0.1:8000/search/',{'searchName':this.props.Name})
		.then(res=>{
			this.setState({'datas':res.data.data});
		})
	}

	render(){
		return(
			<div>
			{this.state.datas?<div className='SearchScreen'>
				<h1>Search results for {this.props.Name}</h1>

				{this.state.datas.data.map(d=>{return(
					<div key={d.id}>
						<ServiceCard 
						Image={d.MainImage} 
						Type={d.Type} 
						ShopName={d.ShopName}
						handleOpenService={()=>this.props.handleOpenService(d.id)}
						/>
					</div>
				)})}

			</div>:''}
			</div>
		);
	}
}

export default SearchScreen;
